lse}], 'milestone': None, 'comments': 2, 'created_at': '2022-03-25T06:01:19Z', 'updated_at': '2022-03-25T16:54:44Z', 'closed_at': None, 'author_association': 'NONE', 'active_lock_reason': None, 'body': 'The scope of Azure Analysis Service is **https://*.asazure.windows.net** per https://docs.microsoft.com/en-us/azure/analysis-services/analysis-services-async-refresh#authentication, while getting token for this I get following error

```
AzureCliCredential authentication failed: The specified scope is not in expected format. 
Only alphanumeric characters, '.', '-', ':', and '/' are allowed (Parameter 'scope')
```
Here is the code
```
var resource = "https://*.asazure.windows.net";
var cred = new DefaultAzureCredential();
cred.GetToken(new TokenRequestContext(new string[] { $"{resource}/.default" }));
```', 'reactions': {'url': 'https://api.github.com/repos/Azure/azure-sdk-for-net/issues/27749/reactions', 'total_count': 0, '+1': 0, '-1': 0, 'laugh': 0, 'hooray': 0, 'confused': 0, 'heart': 0, 'rocket': 0, 'eyes': 0}, 'timeline_url': 'https://api.github.com/repos/Azure/azure-sdk-for-net/issues/27749/timeline', 'performed_via_github_app': None}, 'comment': {'url': 'https://api.github.com/repos/Azure/azure-sdk-for-net/issues/comments/1079216459', 'html_url': 'https://github.com/Azure/azure-sdk-for-net/issues/27749#issuecomment-1079216459', 'issue_url': 'https://api.github.com/repos/Azure/azure-sdk-for-net/issues/27749', 'id': 1079216459, 'node_id': 'IC_kwDOACyxMM5AU4lL', 'user': {'login': 'schaabs', 'id': 11322348, 'node_id': 'MDQ6VXNlcjExMzIyMzQ4', 'avatar_url': 'https://avatars.githubusercontent.com/u/11322348?v=4', 'gravatar_id': '', 'url': 'https://api.github.com/users/schaabs', 'html_url': 'https://github.com/schaabs', 'followers_url': 'https://api.github.com/users/schaabs/followers', 'following_url': 'https://api.github.com/users/schaabs/following{/other_user}', 'gists_url': 'https://api.github.com/users/schaabs/gists{/gist_id}', 'starred_url': 'https://api.github.com/users/schaabs/starred{/owner}{/repo}', 'subscriptions_url': 'https://api.github.com/users/schaabs/subscriptions', 'organizations_url': 'https://api.github.com/users/schaabs/orgs', 'repos_url': 'https://api.github.com/users/schaabs/repos', 'events_url': 'https://api.github.com/users/schaabs/events{/privacy}', 'received_events_url': 'https://api.github.com/users/schaabs/received_events', 'type': 'User', 'site_admin': False}, 'created_at': '2022-03-25T16:54:44Z', 'updated_at': '2022-03-25T16:54:44Z', 'author_association': 'CONTRIBUTOR', 'body': "@zhiweiv Sorry you've run into this problem. Have you tried using the actual host of the server you're trying to connect to? According to the docs you link to it seems the host is region specific, so if you haven't already, could you try using the specific host rather than the wildcard. For example if your instance is in the west us region try `https://westus.asazure.windows.net/.default` rather than `https://*.asazure.windows.net`", 'reactions': {'url': 'https://api.github.com/repos/Azure/azure-sdk-for-net/issues/comments/1079216459/reactions', 'total_count': 0, '+1': 0, '-1': 0, 'laugh': 0, 'hooray': 0, 'confused': 0, 'heart': 0, 'rocket': 0, 'eyes': 0}, 'performed_via_github_app': None}}

