+        public new Azure.Identity.TokenCredentialDiagnosticsOptions Diagnostics { get { throw null; } }', 'path': 'sdk/identity/Azure.Identity/api/Azure.Identity.netstandard2.0.cs', 'position': 13, 'original_position': 13, 'commit_id': '16787fb943d9de3aff555d9a21bcb092c87dc002', 'original_commit_id': '16787fb943d9de3aff555d9a21bcb092c87dc002', 'user': {'login': 'schaabs', 'id': 11322348, 'node_id': 'MDQ6VXNlcjExMzIyMzQ4', 'avatar_url': 'https://avatars.githubusercontent.com/u/11322348?v=4', 'gravatar_id': '', 'url': 'https://api.github.com/users/schaabs', 'html_url': 'https://github.com/schaabs', 'followers_url': 'https://api.github.com/users/schaabs/followers', 'following_url': 'https://api.github.com/users/schaabs/following{/other_user}', 'gists_url': 'https://api.github.com/users/schaabs/gists{/gist_id}', 'starred_url': 'https://api.github.com/users/schaabs/starred{/owner}{/repo}', 'subscriptions_url': 'https://api.github.com/users/schaabs/subscriptions', 'organizations_url': 'https://api.github.com/users/schaabs/orgs', 'repos_url': 'https://api.github.com/users/schaabs/repos', 'events_url': 'https://api.github.com/users/schaabs/events{/privacy}', 'received_events_url': 'https://api.github.com/users/schaabs/received_events', 'type': 'User', 'site_admin': False}, 'body': "We did consider that, but this doesn't work as we can't change the return type when overriding while targitting netstandard2.0. After prototyping several different ways to override the `DiagnosticsOptions` and `RetryOptions` we ended up preferring this design as it keeps the logic of copying default values from `ClientOptions.Default`, in the `Azure.Core` library and doesn't introduce the possibility of derived types not honoring the static defaults. Also, in this design the base class is still responsible for storing the `Diagnostics` options as well so we don't end up creating duplicate instances. All the new property here does is cast the base property to the more specific type `TokenCredentialDiagnosticsOptions`, so there's no harm in it not being respected when a user down casts the `TokenCredentialOptions` type to `ClientOptions`. The same instance will be returned just as the base type, `DiagnosticsOptions`.", 'created_at': '2022-03-25T00:19:48Z', 'updated_at': '2022-03-25T00:19:49Z', 'html_url': 'https://github.com/Azure/azure-sdk-for-net/pull/27520#discussion_r834853002', 'pull_request_url': 'https://api.github.com/repos/Azure/azure-sdk-for-net/pulls/27520', 'author_association': 'CONTRIBUTOR', '_links': {'self': {'href': 'https://api.github.com/repos/Azure/azure-sdk-for-net/pulls/comments/834853002'}, 'html': {'href': 'https://github.com/Azure/azure-sdk-for-net/pull/27520#discussion_r834853002'}, 'pull_request': {'href': 'https://api.github.com/repos/Azure/azure-sdk-for-net/pulls/27520'}}, 'reactions': {'url': 'https://api.github.com/repos/Azure/azure-sdk-for-net/pulls/comments/834853002/reactions', 'total_count': 0, '+1': 0, '-1': 0, 'laugh': 0, 'hooray': 0, 'confused': 0, 'heart': 0, 'rocket': 0, 'eyes': 0}, 'start_line': None, 'original_start_line': None, 'start_side': None, 'line': 311, 'original_line': 311, 'side': 'RIGHT', 'in_reply_to_id': 834789339}, 'pull_request': {'url': 'https://api.github.com/repos/Azure/azure-sdk-for-net/pulls/27520', 'id': 877883573, 'node_id': 'PR_kwDOACyxMM40U3C1', 'html_url': 'https://github.com/Azure/azure-sdk-for-net/pull/27520', 'diff_url': 'https://github.com/Azure/azure-sdk-for-net/pull/27520.diff', 'patch_url': 'https://github.com/Azure/azure-sdk-for-net/pull/27520.patch', 'issue_url': 'https://api.github.com/repos/Azure/azure-sdk-for-net/issues/27520', 'number': 27520, 'state': 'open', 'locked': False, 'title': 'IsAccountIdentifierLoggingEnabled', 'user': {'login': 'christothes', 'id': 1279263, 'node_id': 'MDQ6VXNlcjEyNzkyNjM=', 'avatar_url': 'https://avatars.githubusercontent.com/u/1279263?v=4', 'gravatar_id': '', 'url': 'https://api.github.com/users/christothes', 'html_url': 'https://github.com/christot